import React,{useState, useEffect} from "react";
import logo from './logo.svg';
import './App.css';
import axios from "axios";

const Planes = () => {
    const [planes, setPlanes] = useState([]);
    const fetchPlanes = () => {
        axios.get("http://localhost:8081/planes").then(res => {
           console.log(res); 
           setPlanes(res.data);
        });
    }
    useEffect(() => {
       fetchPlanes();
    }, []);
    return planes.map((plane, index) => {
        return (
                <div key={index}>
                    <h1>{plane.icao}</h1>
                    <p>{plane.origin_country}</p>
                    <p>{plane.latitude}</p>
                    <p>{plane.longitude}</p>
                </div>
        )
    })
} 

function App() {
  return (
    <div className="App">
        <Planes />
    </div>
  );
}

export default App;
